import React from 'react';
import { NavLink } from 'react-router-dom';


export default function NavBar() {
  return (
        <nav className="navbar navbar-toggleable-md fixed-top navbar-inverse bg-invers">
            <NavLink to="/articles"> <h3>Articles</h3> </NavLink>
            <NavLink to="/" activeClassName="selected" className="nav-link"><a className="nav-link">Home</a></NavLink>
            <NavLink to="/articles/new" activeClassName="selected" className="nav-link"><a className="nav-link">Create</a></NavLink>
        </nav>

  )
}
